import { Routes, Route } from "react-router-dom"
import Destination from "./Destination";
import Home from "./Home"

function App() {
  return (
  <>
  <Routes>
    <Route path='/' element={<Home/>}/>
     <Route path='/Destination' element={<Destination/>}/>
      <Route path='/Destination' element={<Destination/>}/>
  </Routes>
  </>
  );
}

export default App;
